var generate = document.querySelector('.generate');
var create = document.querySelector('.getmodel');
var sidunafn = document.querySelector('.generatednafn');
create.addEventListener('click', get_model);
generate.addEventListener('click', generate_nafn);


var existing_names;
var model;
var N = 3;
var maxlength = 20;

function get_model(){
  if(document.getElementById("kk").checked) {
    fetch("https://raw.githubusercontent.com/davidsteinar/nynefni/master/models/IS_male_3gram.json")
    .then(response => response.json())
    .then(data => sessionStorage.setItem('karla_model',JSON.stringify(data)));
    
    existing_names = karlanofn;
    model = JSON.parse(sessionStorage.getItem('karla_model'));
  }
  else if(document.getElementById("kvk").checked){
    fetch("https://raw.githubusercontent.com/davidsteinar/nynefni/master/models/IS_female_3gram.json")
    .then(response => response.json())
    .then(data => sessionStorage.setItem('kvenna_model',JSON.stringify(data)));
    
    existing_names = kvennanofn;
    model = JSON.parse(sessionStorage.getItem('kvenna_model'));
  }
}

function generate_nafn(){
  var startkey = startofname.value;
  var start = " ".repeat(N) + startkey;
  var initkey = start.slice(start.length-N,start.length)
  var iteration = 0;
  const max_iterations=100000;

  while(true){
    var nafn = start;
    var key = initkey;
    for(var i=0; i<maxlength; i++){
      var probability = Math.random();
      for(var letter in model[key]) {
        probability -= model[key][letter];
        if(probability < 0){
          break;
        }
      }
      nafn = nafn + letter;
      key = nafn.slice(nafn.length-N,nafn.length);
      if(letter == " "){
        nafn = nafn.trim();
        break;
      }
      if(i === maxlength-2){
        nafn=nafn.trim();
        break;
      }
    }
    
    if(includes(existing_names, nafn) === false){
      existing_names.push(nafn);
      sidunafn.textContent = nafn;
      sidunafn.style.visibility = 'visible';
      break;
    }
      
    iteration += 1;
    if(iteration>max_iterations){
      
      sidunafn.textContent = "Ekkert nafn fannst";
      sidunafn.style.visibility = 'visible';
      break;
    }
  }
}